B.Hg=new A.a9("The PEG ratio shows the relationship between a company\u2019s P/E and its earnings growth. It is found by dividing the P/E ratio by the earnings growth rate over a 1,3, or 5-year period. It is best used to determine if a stock is overvalued or undervalued, and helps investors determine if a stock is fairly priced.\n",null,B.j,null)
