B.GD=new A.a9("If Augmen Investment Services (AIS) has a P/E ratio of 25 and a 5-year earnings growth rate of 12.50%, its PEG ratio would be found by dividing 25 by 12.50, which would make it have a value of 2.00.\n",null,B.j,null)
