B.Gz=new A.a9("EBITDA is the measure of a company\u2019s earnings before factoring in interest, taxes, depreciation (decreases in value of an asset), and amortization (installments of paying off debt). It allows for easy comparison between companies to judge their profitability without factoring in values like debt that may vary between businesses.\n",null,B.j,null)
B.GA=new A.a9("If Augmen Investment Services (AIS) had earnings of $100.00, interest totaling $10.00, taxes of $30.00, depreciation of $20.00, and amortization of $10.00, its EBITDA would be found by adding all of those values together. Thus, the EBITDA would have a value of $170.00.\n",null,B.j,null)
B.H6=new A.a9("EBITDA Margin: EBITDA/Revenue\nAdditionally, comparing EBITDA to a company\u2019s revenue can also paint a picture of a firm\u2019s overall financial health. Specifically, an EBITDA margin of 10% or greater is considered good, and most companies in the S&P 500 have this percentage.",null,B.j,null)
