B.GX=new A.a9("Change is the difference between a stock\u2019s current price and its value at the previous business day\u2019s close. It is calculated by subtracting the stock\u2019s previous close from its current value, and it can be expressed as a positive or negative value. Specifically, if the stock\u2019s current value is less than the previous day\u2019s close, the stock\u2019s change would be a negative number.\n",null,B.j,null)
B.GR=new A.a9("If Augmen Investment Services (AIS) has a current share price of $24.37 and its previous day\u2019s close was $23.46, its change would be found by subtracting $23.46 from $24.37, giving it a value of $0.91.\n",null,B.j,null)
B.H7=new A.a9("A stock\u2019s change is best used to inform the investor of short-term gains or losses that may be affecting a stock. Specifically, an investor who sees a large change would be prompted to investigate the current events concerning that company to determine if more gains are likely. Additionally, a consistent, positive change over the course of days or weeks may indicate a bullish pattern that could signal a good time to invest. However, this is to be taken with caution as there are many factors that influence a stock\u2019s price, and a bullish pattern is not solely enough to determine whether a stock is a good buy.",null,B.j,null)
B.Al=A.b(s([B.a1,B.GX,B.a_,B.GR,B.a0,B.H7]),t.O)
