B.Hk=new A.a9("A stock\u2019s low is its smallest trading price within the active hours of a stock exchange. It is useful for day traders as a measure of support, or minimum trading level, and influences their decisions to buy or short a stock. Specifically, some day traders will purchase a stock when it approaches close to the daily low, as the belief is that the stock will not pass below that value. Granted, this is a very risky method of investing as there are many factors that could push a stock\u2019s price below its daily high.\n",null,B.j,null)
B.H4=new A.a9("If Augmen Investment Services (AIS) opens at a price of $27.00, at noon is at $24.00 and closes at $35.00, the low for the day is $24.00.\n",null,B.j,null)
B.GC=new A.a9("Similar to the daily high, a stock\u2019s low gives information about trends. Like the high and the opening price, a consistently increasing daily high may indicate a bullish pattern that could signal a good time to invest. Again, this is to be taken with caution as there are many factors to consider when investing in a stock, and a bullish pattern is not solely enough to determine whether a stock is a good buy.",null,B.j,null)
