B.Gp=new A.a9(null,B.Aj,B.j,B.a2)
B.GU=new A.a9("A stock\u2019s Avg Vol (Average Volume) indicates, on average, how many shares have been bought or sold throughout a trading day. The average volume is calculated by dividing a stock\u2019s total number of trades over a certain period by however many days were in that timeframe. The average volume is useful through comparison to the daily volume and is a good judge of how impactful a single investor can be on a company\u2019s share price.\n",null,B.j,null)
B.H1=new A.a9("If Augmen Investment Services (AIS) was traded 50 times on June 1, 45 times on June 2, 110 times on June 3, 20 times on June 4, and 30 times on June 5, its average volume would be found by adding 50 to 45, 110, 20, and 30, and dividing that sum by the number of days, which is 5. Thus, the average volume would be found by dividing 255 by 5, which would produce a value of 51.\n",null,B.j,null)
B.Hb=new A.a9("A stock\u2019s average volume can be used as a good benchmark figure in comparison to the daily volume. Specifically, increases in the daily volume far above the average volume are signals of rising investor demand, and could once again be the determiners of a bullish or bearish pattern. The average volume is such a good benchmark because it is not susceptible to sudden daily increases or decreases of the daily volume, and therefore it maintains a steady value that can be adequately compared against. Moreover, a high average volume can reassure investors that the actions of one trader will not dramatically affect the share price of the stock. Specifically, stocks with low average volumes could be strongly influenced by a major selloff from one investor, whereas companies with high average volumes would be less affected as there are many other investors making their own decisions. Thus, investors looking to minimize risk and take advantage of small, but more consistent returns tend to go with stocks with high average volumes.",null,B.j,null)
