B.Gv=new A.a9(null,B.Af,B.j,B.a2)
B.GT=new A.a9("Enterprise Value is the measure of a company\u2019s worth, including its outstanding debts. It is found by adding the company\u2019s Market Capitalization to its net debt and subtracting the value of its cash reserves. It is also the potential price that the company would be purchased for, as it contains both the company\u2019s value and the liabilities it needs to pay off.\n",null,B.j,null)
B.Gn=new A.a9("If Augment Investment Services (AIS) were to have earnings of $100.00, debt of $50.00, and cash reserves totaling $20.00, its enterprise value would be found by adding $100.00 to $50.00 and subtracting $20.00, which would make its EBITDA have a value of $130.00.\n",null,B.j,null)
B.He=new A.a9("EV/EBITDA: the Enterprise Value to EBITDA ratio compares a company\u2019s worth to its earnings. It is a good evaluation of whether a company is properly, over, or undervalued. Typically, the lower the EV/EBITDA ratio the better, and a value of 10 or below is generally considered good and a signal of a potential investment.",null,B.j,null)
