B.Gm=new A.a9("A stock\u2019s high is its greatest trading price within the active hours of a stock exchange. It is useful for day traders as a measure of resistance, or maximum trading level, and influences their decisions to buy or short a stock. Specifically, some day traders will short a stock when it approaches close to the daily high, as the belief is that the stock will not pass above that value. Granted, this is a very risky method of investing as there are many factors that could push a stock\u2019s price above its daily high.\n",null,B.j,null)
B.H9=new A.a9("If Augmen Investment Services (AIS) opens at a price of $53.00, at noon is at $56.00 and closes at $49.00, the high for the day is $56.00.\n",null,B.j,null)
B.Gs=new A.a9("Although it is a simpler topic, a stock\u2019s high still gives information about trends. Like the opening price, a consistently increasing daily high may indicate a bullish pattern that could signal a good time to invest. Similarly, this should be taken with a grain of salt as there are many other factors to consider when evaluating whether one should invest in a certain stock.",null,B.j,null)
