B.GQ=new A.a9("Yield is the relationship between a company\u2019s yearly dividends and its share price. It is the percent of a company\u2019s stock price that equals its yearly dividend for one share. A dividend is a payment that a company will give out for being a shareholder, and its purpose is to share the profits from the year with those who invested in the company.\n",null,B.j,null)
B.GG=new A.a9("If Augmen Investment Services (AIS) had a yearly dividend of $4.00 and had a share price of $200.00, its yield % would be found by dividing 4.00 by 200.00 and multiplying that number by 100. Thus, the yield % would equal 0.02 times 100, which would give it a value of 2.00%.\n",null,B.j,null)
B.Gk=new A.a9("A company\u2019s yield is one factor in the decision to invest in a stock. Specifically, investors hoping to capture small, yet consistent returns would be drawn to stocks with a high dividend percentage as they would be guaranteeing themselves some money back each year. Thus, traders hoping to consistently reinvest their earnings and have a constant source of income would be drawn to stocks with a high dividend yield. On the other hand, traders focused on investing in stocks with huge growth potential might be cautious of investing in stocks with high dividend yield, as those companies don\u2019t reinvest as much of their profits and fail to fully maximize their growth. Both a high yield and a low yield are great, it just depends on the investor and what goals they are hoping to achieve.",null,B.j,null)
B.zK=A.b(s([B.a1,B.GQ,B.a_,B.GG,B.a0,B.Gk]),t.O)
B.GB=new A.a9(null,B.zK,B.j,B.a2)
B.H8=new A.a9("A stock\u2019s close is the price that a stock last trades at during a stock exchange\u2019s active hours. The New York Stock Exchange (NYSE) operates from 9:30 AM to 4:00 PM ET every Monday through Friday outside of federal holidays. The close is the price of the last executed trade, and even though it is the price of a stock the night before it doesn\u2019t have to be the price of a stock the following morning. Specifically, after-market trading and a company\u2019s news releases can alter its price throughout the night, and can create the look of a sharp increase or decrease in the stock\u2019s price the following morning.\n",null,B.j,null)
